      "tags_section": null,
      "ntokens": null,
      "text": "16. Bey Hrn. Rudolf Ramsperger an der Huthgass ist extra guter Holländischer-Taback in beysern Pfund-Büchsen à 10 Döschen, wie auch guter St. Vincent à 8 ßg, zu haben."
    },
    {
      "date": null,
      "tags_section": null,
      "ntokens": null,
      "text": "17. Broc guter Art grosse Bohnen zum Seppen, schöne kleine weisse dito zum Kochen in billigem Preis zu haben, im Berichthaus ohne Entgeld zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "ntokens": null,
      "text": "18. Zwey Barthlehen oder Professor-Huth, wie auch ein ganz neuer Castor-Huth, mittelmäßiger Größe, im Berichthaus zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "ntokens": null,
      "text": "19. Bey Hrn. Burkhardt zum Riesen sind extra neue grosse Italienische Feigen, dito grosse Meertrauben mit und ohne Stiel, Haselnuß, dürre Mirchen, feiner Chocoladen, alles in billigem Preis zu haben."
    },
    {
      "date": null,
      "tags_section": null,
      "ntokens": null,
      "text": "20. Zwölf Sack neuer Waizen in billigem Preis, im Berichthaus ohne Entgeld zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "ntokens": null,
      "text": "21. Bey Hrn. Jacob Grimm Buchbinder ist zu haben: 1) Ein Kriegs-Atlas von 8 theils Landkarten, Städten, Plans von Bataillonen und Belagerungen des letzten Kriegs. 2) Die Welt in einer Nuß mit Kupfern. 3) Die Durchlauchtigste Welt, 4) Exel mit Wappen. 5) Journal du camp de Compiegne avec figures."
    },
    {
      "date": null,
      "tags_section": null,
      "ntokens": null,
      "text": "22. Zwey saubere französische Bäder in ein Wirths-Haus auf das Land oder in ein Bad dienlich, gehorsamlich im Berichthaus zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "ntokens": null,
      "text": "23. Eine Bachsaune in der Aschener Vorstadt mit 4 Stuben, Kammern samt einer grossen Werkstatt, Stieg und einem schönen geschönten Alter und Garten, weshalb sich bey Hrn. Jacob Maglin dem Weinmann anzumelden."
    },
    {
      "date": null,
      "tags_section": null,
      "ntokens": null,
      "text": "24. Ein Freund, welcher circa 600 Sester Hanf-Samen anhero liefern könnte, möchte aber solchen vorher verkauft wissen, offerirt deßen selbstgen daran in billigem Preis, im Berichthaus zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "ntokens": null,
      "text": "25. Wo guter alter weisser Wein zu haben, ist bey Hrn. Michael Fuchs dem Kiefer zu vernehmen."
    },
    {
      "date": null,
      "tags_section": null,
      "ntokens": null,
      "text": "26. Circa 6 Saum extra guter alter von rother Mosel-Wein, so gut als Newenburger oder Burgunder, in billigem Preis, im Berichthaus zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "ntokens": null,
      "text": "27. Zwey Stücklein weissen Wein von 1760, 3 Pfund 10 ß der Saum im ersten, und 8 Pfund im andern, wovon nach Belieben zu haben, im Berichthaus ohne Entgeld zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "ntokens": null,
      "text": "28. Ein Stock Heu ab 3 Saumen Matten vorm Riechmer Thor oberhalb der Schorenbruck, Ferner ein Stücklein von 7 Saumen rothes Bolliger-Wein von 1760, schon roth und lauter, im Berichthaus ohne Entgeld zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "ntokens": null,
      "text": "29. Auf C. E. Zunft zum Bären sind wiederum neue Saure Rüben in billigem Preis zu haben."
    },
    {
      "date": null,
      "tags_section": null,
      "ntokens": null,
      "text": "30. Ein roths Scharlachens Garnsack und Hosen in billigem Preis, im Berichthaus zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "ntokens": null,
      "text": "31. Im Wiesenburger-Hof ist wohlverwahrter Bau zu haben."
    },
    {
      "date": null,
      "tags_section": null,
      "ntokens": null,
      "text": "32. Ein Brennwäldlein bey der Stetten-Müliin mit aller Vortheiligkeit, im Berichthaus ohne Entgeld zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "ntokens": null,
      "text": "33. Bey weichen rother und weisser Burgunder, wie auch Muscat-Wein, Bienenwachs wegen Mangel blos, wie auch roth und weisser Essiger Marggraff-Wein in billigem Preiß zu haben, ist im Berichthaus ohne Entgeld zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "ntokens": null,
      "text": "34. Feine wiedergeblaßte Hamburger-Strick-Wollen das Pfund à 6 Pfund, wo dieselbe Pfundweis zu haben, ist im Berichthaus ohne Entgeld zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "ntokens": null,
      "text": "35. Herrn Hofzahn der Siegritz Behaußung im Spiegelgäßlein mit 4 Stuben, 3 Kammern etc. ist entweder zu verkaufen, oder samtschaft zu verleihen."
    },
    {
      "date": null,
      "tags_section": null,
      "ntokens": null,
      "text": "36. Weisse und rothe Marggraffer-Weine von 1760, wovon in billigem Preiß nach Belieben zu haben, im Berichthaus zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "ntokens": null,
      "text": "37. Ein Mannsbild in St. Peters Kirch auf dem Flecken, Item ein grüner Tonbeutel mit grünem wollenen Umbange, in billigem Preis, im Berichthaus zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "ntokens": null,
      "text": "38. Ein Hausklättchen mit einem schönen Bild und Zugehörd in billigem Preiß, im Berichthaus zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "ntokens": null,
      "text": "39. Der Bärenherren-Hof zu St. Peter, mit Garten, Stallung, Keller etc. wie der Augenschein zeigen wird. In Ermangelung eines Käufers"
    }
  ]
}
